import React from "react";
import UserList from "../components/UserList";

const User = () => {
    const USERS = [
        (id: "u1"),
        (name: "Max"),
        (image: "https://www.planetware.com/wpimages/2019/11/india-best-places-to-visit-agra.jpg"),
        (places: 3),
    ];

    return <UserList items={USERS} />;
};

export default User;
